import React from 'react';
import styled from 'styled-components'

const Box = styled.div`
    box-sizing: border-box;
    margin: 0;
    padding: 0;
    color: rgba(0,0,0,.65);
    font-size: 14px;
    line-height: 1.5;
    list-style: none;
    position: relative;
    background: #fff;
    border-radius: 2px;
    transition: all .3s;
`

const Content = () => {
  return (
    <Box>
      <p>la la la</p>
    </Box>
  )
}

export default Content;
